(1, '<p></p><h2 align="left">Who We Are</h2><p><b>RedTake Media</b> is a marketing agency which works with no fuzz, jargons and sham promises, just plain simple common sense. It is this common sense that helps us to deliver to our clients desired measurable output.We always operate as an extension to your business. Your Marketing Back Office if you will, which means we share the same passion for your business and the same pride as we see it grow. As an integrated marketing solutions company from events to exhibitions, from promotions to retail solutions, from website/presentation to viral marketing we do it all.RedTake Media takes away your stress of running between agencies.</p><h3>Our Expertise</h3>\r\n<p>\r\n</p><div class="col-md-3">\r\n<ul>\r\n<li>product Launch</li>\r\n<li>Channel Partner Meets</li>\r\n<li>Guru Seminars</li>\r\n<li>Tech. Parthner Programs</li>\r\n<li>Awared Show</li>\r\n<li>Gaming Competitions</li>\r\n<li>Concerts</li>\r\n<li>Fashion Shows</li>\r\n<li>Conferences &amp; Seminars</li>\r\n<li>Entertainment Nights</li>\r\n</ul>\r\n</div>\r\n<div class="col-md-3">\r\n<ul>\r\n<li>Corporate Facility Launch</li>\r\n<li>Signature Events</li>\r\n<li>Televised Events</li>\r\n<li>Commercial EVents</li>\r\n<li>Special Events</li>\r\n<li>Dealer Meets</li>\r\n<li>Customer Meets</li>\r\n<li>Networking Events</li>\r\n<li>Cultural Events</li>\r\n<li>Annual Days</li>\r\n</ul>\r\n</div>\r\n<div class="col-md-3">\r\n<ul>\r\n<li>Turnkey Booth Management</li><li>Booth Design Consultancy</li>\r\n<li>Booth Fabrication &amp; Structuring</li>\r\n<li>Booth Audio Visual Development</li>\r\n<li>Exhibition Specific Collateral Design</li>\r\n<li>Manpower Support</li>\r\n<li>Customer Meets</li>\r\n<li>Booth Fabrication</li>\r\n<li>Booth Structuring</li>\r\n\r\n</ul>\r\n</div>\r\n<div class="col-md-3">\r\n<ul>\r\n<li>Design &amp; Consultancy</li>\r\n<li>Graphic Designing</li><li>Interiors</li>\r\n<li>Furniture</li>\r\n<li>Signages</li>\r\n<li>Display Ads</li>\r\n<li>Model Making</li>\r\n<li>Stand Condtruction</li></ul><p><br></p>\r\n</div>\r\n<hr style="clear:both;">\r\n<p></p><p><br></p><div class="col-md-3">\r\n<ul><li>Experientaial Campaigns</li><li>Touch Point Marketing</li><li>Road Show</li><li>School Contact Programs</li><li>Promotions</li><li>Corporate Contact Programs</li><li>Static / Live Mall and RWA Promotions</li><li>Consumer Road Show</li><li>Consumer Contact Programs</li><li>School / College Contact Programs</li><li>Booth Structuring</li><li>IN Shop Promotions<br></li></ul>\r\n</div><div class="col-md-3">\r\n<ul><li>Sampling</li><li>Demo</li><li>Custom Made Promotion Merchandise</li><li>TransPortation Medium Promotions</li><li>Canopy / Pre-fabrication Medium Promotions</li><li>Static in Markets, Malls</li><li>Live in Markets, Mall , HTA''s</li><li>Mall Promotions</li><li>Ho / RE / CA Promotions</li><li>RWA Promotions</li></ul>\r\n</div><div class="col-md-3">\r\n<ul><li>Response Management</li><li>Lead Generation</li><li>Toll Free / Helpline Numbers</li><li>Database solutoions</li><li>product demo appointments</li><li>Pre- sales calling</li><li>post sales calling</li><li>Demo follow up</li><li>After sale service calls</li><li>Relationship calls</li><li>VAS Calls</li><li>SMS Follow ups</li><li>Market Dip-stick<br></li></ul>\r\n</div><div class="col-md-3">\r\n<ul><li>Online Helpline / Support Service<br></li><li>Channel / End User Meets</li><li>product demo shows</li><li>partner programs</li><li>guru seminars</li><li>specialty workshops</li><li>Toll Free Nos</li><li>Indiviual City Nos.</li><li>SMS Broadcast</li><li>Create New Databases</li><li>Outsourced Database Management</li><li>Email marketing Campaigns</li><li>Direct Marketing/Response</li><li>Audience Acquiisition<br></li></ul><p><br></p>\r\n</div><p>\r\n<br></p><hr style="clear:both;"><p>\r\n</p><div class="col-md-3">\r\n<ul><li>Rich Media</li><li>New&nbsp; Media</li><li>Corporate Presentations</li><li>Interactive Product Catalouges</li><li>Flash intros</li><li>Coporate films</li><li>Media development</li><li>Audio Visuals(AVs)</li><li>Business Promotions Films</li><li>E-Learning</li><li>Instructions and Training Films</li><li>Computer Based Tutorials(CBTs)</li><li>Web Based Tutorials(WBTs)</li><li>Integration of Courses</li><li>Online Solutions</li><li>corporate Website Designing<br></li></ul></div><p>\r\n</p><div class="col-md-3">\r\n<ul><li>Website Re-designing</li><li>Flash Website Designing</li><li>Homepage Designing</li><li>Template Designing Services</li><li>Customized Web Application</li><li>Customized Work Flow Management</li><li>Intranet development</li><li>Communication Portal</li><li>Application Migration</li><li>Content Management system(CMS)</li><li>Viral Marketing</li><li>E-Commerce</li><li>conversion of courses</li><li>Social Media Optimization</li><li>Online Campaigns</li><li>social Marketing Campaigns</li><li>Mobile Marketing Campaigns<br></li></ul>\r\n</div><p>\r\n</p><div class="col-md-3">\r\n<ul><li>Retail Activation<br></li><li>Retail Merchandising</li><li>Retail Adults and Dip-stick analysis</li><li>Large Field Force Activation</li><li>Market Intelligence &amp; Analysis</li><li>Sampling and Adults</li></ul>\r\n</div><p>\r\n</p><div class="col-md-3">\r\n<ul><li>Mystery Shopper Programs</li><li>Time Bound Installations</li><li>Permanent Installations</li><li>Kiosks</li><li>Shop-in-Shops</li><li>POP &amp; POS</li></ul></div><p>\r\n</p><hr style="clear:both;"><p>\r\n</p><p><br></p><p><br></p><p><br></p><p><br></p>'),
(2, '<div id="posts" class="faq_cont">\r\n                <div class="contentt">\r\n                    <ul class="faq_ul">\r\n                        <li><a href="#therapy_beneficial" class="">How is the therapy beneficial ?</a></li>\r\n                        <li><a href="#magnetism">What is Electromagnetism ?</a></li>\r\n                        <li><a href="#joints">What is the reason behind pain in joints ?</a></li>\r\n                        <li><a href="#pain">How is this therapy helpful in reducing pain ?</a></li>\r\n                        <li><a href="#benefits">List the general benefits of the therapy</a></li>\r\n                        <li><a href="#healing">Does it helpful in wound healing ?</a></li>\r\n                        <li><a href="#side_effects" class="active">Does the therapy have any side effects ?</a></li>\r\n                        <li><a href="#except_therapy">What can you expect from therapy ?</a></li>\r\n                        <li><a href="#therapy_session">What to expect during a therapy session ?</a></li>\r\n                        <li><a href="#contraindications">Are there any contraindications to use PEMF therapy ?</a></li>\r\n                    </ul>\r\n                </div>\r\n                <section id="therapy_beneficial">\r\n                <p class="contentt"> <b style="font-weight: bold;">How is the therapy beneficial? </b><br>\r\n                    Pulsed Electromagnetic Field is regarded as an integrative treatment that stimulates the damaged cells by bringing on the electrical changes within the cell that help to restore it to normal state. This therapy is beneficial because very low range of electromagnetic fields is used to create resonance within the human cells. It helps to reduce pain and inflammation by enhancing the circulation system and reviving the oxygenation process.</p>\r\n                </section>\r\n                <section id="magnetism">\r\n                <p class="contentt"> <b style="font-weight: bold;">What is Electromagnetism?</b> <br>\r\n                    Electromagnetism is a process which occurs due to interaction of magnetic and electrical effect. It is one of the most important concepts of physical science. The electromagnetic comprise of a soft piece of iron which is wrapped with electrical wires. When electric current flows through it, this creates a magnetic field and the iron gets magnetized. The stronger is the magnetic field the greater is the current.</p>\r\n                </section>\r\n                <section id="joints">\r\n                <p class="contentt"> <b style="font-weight: bold;">What is the reason behind pain in joints?</b> <br>\r\n                    Our bones are made up of cartilage cushions but with age and due to occurrence of diseases like osteoarthritis, injury or osteoporosis our bones begin to lose calcium. As the layer of cartilages thins the bones grind causing extreme pain. Under the normal condition our body replaces the cartilage with the help of electrical signals. These are created outside body. The replacement of cartilage is misbalanced due to which there is pain and inflammation.</p>\r\n                </section>\r\n                <section id="pain">\r\n                <p class="contentt"> <b style="font-weight: bold;">How is this therapy helpful in reducing pain?</b> <br>\r\n                    This therapy helps because pulsating electromagnetic fields influence the cell behavior by creating electrical changes around and within the cell. The improved blood supply increases the oxygen pressure activating and regenerating the cells. Then the increased calcium in the body makes the bones stronger decreasing the pain. Thus it leads to healing of fracture and less risk of bone breaking.</p>\r\n                </section>\r\n                <section id="benefits">\r\n                <div class="contentt" style="margin: 0px;">\r\n                    <b style="font-weight: bold;">List the general benefits of the therapy</b> <br>\r\n                    The following are the health benefits of using this therapy which are:<br>\r\n                    <ul>\r\n                        <li>Balances the acupuncture meridians of the body within few minutes</li>\r\n                        <li>Improves recovery from physical assertion, workouts and strenuous sessions</li>\r\n                        <li>Keeps the immune system strong and provides a gentle magnetic intensity which does not over-stimulate the body.</li>\r\n                        <li>Reduces the pain caused due to arthritis, back pain, muscle stress and bursitis.</li>\r\n                        <li>For healthier metabolism it normalizes the action of the cellular electrical voltage.</li>\r\n                    </ul>\r\n                </div>\r\n                </section>\r\n                <section id="healing">\r\n                <p class="contentt"><b style="font-weight: bold;"> Does it helpful in wound healing? </b><br>\r\n                    This therapy helps in healing of wounds due to pulsating electromagnetic field which improves oxygenation and blood circulation.  The wound healing improves due to transport of nutrients.</p>\r\n                </section>\r\n                <section id="side_effects">\r\n                <p class="contentt"> <b style="font-weight: bold;">Does the therapy have any side effects?</b><br>\r\n                    The best part is that this therapy is absolutely safe and has no side effects. Sometimes the patient might feel a bit prickling due to improved blood circulation but there is no inadvisable prescription.</p>\r\n                </section>\r\n                <section id="except_therapy">\r\n                <p class="contentt"> <b style="font-weight: bold;">What can you expect from therapy? </b><br>\r\n                    The therapy is healthy and relaxing which can reduce or eliminate the need of pharmaceuticals. This can be used on humans as well animals that suffer from stiffness, painful conditions and soreness.</p>\r\n                </section>\r\n                <section id="therapy_session">\r\n                <p class="contentt"> <b style="font-weight: bold;">What to expect during a therapy session? </b><br>\r\n                    This treatment is soothing and all you have to do is lie on the massage table or bed which has the system on it. It requires no physical activity and most humans or animals go to a relaxed condition or simply fall asleep.  They go through a therapeutic experience feeling peaceful, energized, without any aches and pain.</p>\r\n                </section>\r\n                <section id="contraindications">\r\n                <p class="contentt"> <b style="font-weight: bold;">Are there any contraindications to use PEMF therapy?</b> <br>\r\n                    Yes, there are contraindications for the PEMF therapy. It is not meant for persons with pacemaker, pregnancy and epileptics.</p>\r\n                </section>\r\n            </div>'),
(3, '<h1>Quality Standards Delivered</h1>\r\n\r\n<img data-filename="clipboard.png" class="img-responsive Inn-img" src="data:image/png;base64," style="width: 268px; float: right;">\r\n\r\n\r\n\r\n\r\n\r\n<p> The main aim of our organization is to provide quality-proven range \r\nof Fire Extinguisher Products. to our esteemed \r\n\r\npatrons. Our endeavors \r\nare directed towards maintaining quality in all our business operations.\r\n We have quality controllers in our team, who ensure that the entire \r\nrange is manufactured by our vendors in compliance with set industrial \r\nstandards. Further, they test these products on some well-defined \r\nparameters before the delivery. This helps in ensuring the availability \r\nof a defect free range to our clients. Following are the quality \r\nparameters: </p>\r\n\r\n\r\n<ul><li>Durability</li><li>Performance</li><li>Usage<br></li></ul><p></p>\r\n'),
(4, '<h1>Warranty</h1>\r\n\r\n\r\n\r\n<p>  We have well constructed and capacious warehousing unit that allow us in storing the orders. This warehousing unit is installed with all the necessary tools and equipment that helps in various loading and unloading purposes. For keeping the products in the safe manner, our warehouse is properly inspected by the supervisors. Furthermore, this warehousing unit is situated at the prime location where it is connected with all the transportation modes that allow us in the timely delivery of the products. We are also known in the market for our special packaging that is done by our packaging unit. This packaging staff use only best quality of material that ensures the safe delivery of the products.</p>');
INSERT INTO `about` (`id`, `des`) VALUES
(5, '<h1>Disclaimer</h1>\r\n\r\n<img data-filename="clipboard.png" class="img-responsive Inn-img" src="data:image/png;base64," style="width: 268px; float: right;">\r\n\r\n<p> Our organization has recruited the highly skilled and dedicated \r\nprofessionals that are connected with us since our establishment. These \r\nexperts regularly visit at vendors unit to keep check on the entire \r\nproduction process. For enhancing the skills of these professionals, we \r\nconducts regular training sessions and workshops. In order to know the \r\nexact needs of the client, these professionals remain in regular contact\r\n with them and serve them accordingly. Our professionals works in \r\ncomplete coordination with each other that further allows in delivering \r\nthe products in the stipulated time frame.</p>\r\n'),
(6, '<h1>Copyright</h1>\r\n\r\n\r\n\r\n<p>  To carter to the diverse needs of the clients, we are connected with the certified vendors of the market. These vendors make use of top quality raw material in the entire production process to maintain the quality of the products. In order to fulfill the needs of the client, these vendors manufacture the entire product range as per the specification given by the client. Some of the main aspects on which we choose our vendors are mentioned below: </p>\r\n\r\n\r\n<ul>\r\n\r\n    <li>Timely delivery</li>\r\n    <li>Financial stability</li>\r\n    <li>Cost effective</li>\r\n\r\n</ul>'),
(7, '<h1>Welcome to Redtake Media</h1>\r\n					<h3>RedTake Media is a marketing agency which works with no fuzz, jargons and sham promises, just plain simple common sense.</h3>\r\n					<p> It is this common sense that helps us to deliver to our clients desired measurable output.We always operate as an extension to your business. Your Marketing Back Office if you will, which means we share the same passion for your business and the same pride as we see it grow. As an integrated marketing solutions company from events to exhibitions, from promotions to retail solutions, from website/presentation to viral marketing we do it all.RedTake Media takes away your stress of running between agencies.</p>'),
(8, '<h1>Our Products</h1><div class="row"><div class="row-wrapper container "><div class="row"><div class="col-md-12"><p class=" ">\r\n            Proexamine Surgicals Private Limited is the India’s most \r\ntrusted reputed manufacturer and supplier of hospital furniture, \r\northopedic implants, anesthesia products, autoclaves and sterilizer, \r\nscrub and linens, diagnostic equipments and much more.  In fact we have \r\nwidest range of products for hospital, clinics, doctors, surgeons and \r\npatients. </p>\r\n\r\n    </div> \r\n\r\n</div></div></div><p>\r\n    \r\n            </p><p><br>\r\n\r\n        \r\n    \r\n<img class="img-responsive" src="http://proexaminesurgicals.com/media/banners/about_banner.jpg"><br></p>'),
(9, '<h1>Product Portfolio</h1>\r\n\r\n<p>We are a prominent processor and supplier of pure and genuine Herbal Ayurvedic Products. Our products are widely acclaimed for their effectiveness in eliminating problems related to health, skin, beauty and hair. These are widely used by various beauty-parlors, ayurvedic and herbal institutes, spa &amp; massage centers. These products are processed by 100% pure and authentic herbal raw material. Besides, the product of “Aloevera Herbal Concept” is prepared having natural characteristics of nature’s best herbs.  </p>\r\n\r\n\r\n\r\n<h3>Our Team</h3>\r\n\r\n<p>Our people are of the highest caliber and are led by Project leader with substantial experience.  Our people include a mix of Doctors, management graduates, Chemist and technician.   </p>\r\n\r\n<p>The people we recruit have diverse qualifications and have strong technical, industry and management skills.  Their specialist skills that we will bring to your assignment have been developed through their academic background, rigorous internal training and extensive engagement experience.  Our people are committed to exceeding clients'' expectations continuously by delivering services with a strong industry focus, superb technical competence and a commitment to the professional values of integrity and objectivity. Our policy is to have a concentration of diverse qualifications and skills in our people, to enable us to address any specific issues that may arise during an engagement with any client.</p>\r\n\r\n\r\n\r\n<h3>Our Valued Clientele</h3>\r\n\r\n<p>Furthermore, the Company has already started test marketing of its product range at various places in India and abroad and have been receiving tremendous response towards quality of the products. We are having MoU for providing Aloevera herbal products to the following companies in India as well as in abroad:</p>\r\n\r\n<p>At present N.A.R.C has started its own production of Aloevera based skincare/healthcare products at its manufacturing unit in Narsanda (Dist. Kheda). N.A.R.C have already launched its product range in Gujarat, Rajasthan, U.P., Mumbai, and Delhi and are shortly starting marketing operations in Chandigarh, Punjab, Haryana, Himachal Pradesh and J&amp;K. We are receiving encouraging feedback from these areas. We have procured orders from reputed organization like etc. for bulk supply of Aloevera Juice and other healthcare products. Similarly we have arrived at successful negotiations for export for U.K, U.S.A., Canada, Nepal, Holland, UAE etc. </p>\r\n\r\n<h3>International MoU</h3>\r\n\r\n<ul>\r\n    <li>Shakti International Ontario, Canada.</li>\r\n    <li>Kaya Creation,  U.S.A.</li>\r\n    <li>Aloe-Aqua PLC, U.K.</li>\r\n    <li>Trilok PLC, U.K.</li>\r\n    <li>Kotecha PLC, U.K.\r\n    </li><li>Kinara Healthcare, Dubai.</li>\r\n    <li>Abdulla LCC, Dubai.</li>\r\n</ul>\r\n\r\n\r\n<h3>Domestic MoU</h3>\r\n\r\n\r\n<ul>\r\n\r\n\r\n<li>Cadila-Zydus Ltd.</li>\r\n    <li>Air India,</li>\r\n    <li>Indian Railway,</li>\r\n    <li>Hiteshi Herbal Pvt. Ltd., Jaipur.</li>\r\n    <li>Sunrise Pvt. Ltd., Jaipur.</li>\r\n    <li>Surajbala Exports P.Ltd,Delhi</li>\r\n    <li>Noor-E-Such Herbal Pvt. Ltd., Gaziabad.</li>\r\n    <li>Adis Marketing, Ahmedabad.</li>\r\n    <li>Arshnet Pvt. Ltd., Nadiad.</li>\r\n    <li>Lady Care Pvt. Ltd., Anand.</li>\r\n    <li>Dr. Subodh Healthcare Pvt. Ltd., Anand.</li>\r\n    <li>Saraswati Marketing, Anand.</li>\r\n    <li>Ajit Ayurved ,M.P.</li>\r\n</ul>\r\n'),
(10, '<h1>Infrastructure</h1>\r\n\r\n\r\n\r\n\r\n<p>We have developed a state-of-the-art infrastructure at Vadodara, Gujarat, for processing of our Herbal Ayurvedic Products. Our infrastructure is spread over 10000 square meters and we are currently growing more than 225 medicinal plants. Our unit is well-equipped with all the latest technologies to ensure high-grade products to the customers. We have segregated our departments into R&amp;D, quality testing lab &amp; other developmental activities for effective processing. We process these products in compliance with the environmental policies and standard quality parameters to sustain their purity.  </p>\r\n\r\n\r\n<h2>Quality Services Methodology</h2>\r\n\r\n<h3>The Quality Management System at </h3>\r\n\r\n<ul>\r\n<li>QA holds prime responsibility for generating systems and procedures, handling product complaints, audit, process stabilization and validation</li>\r\n<li>Regulatory Affairs prepares QA-related documents for product registration, GMP documentation and answering technical queries</li>\r\n<li>QA regulates sourcing, site approval, GMP maintenance, transfer of technical documents, training support, product technology transfer, daily reviews and audits</li>\r\n<li>For GMP - documentation of critical steps in the manufacturing process and any significant changes made to the process are validated</li>\r\n</ul>\r\n\r\n\r\n<h3>Good Laboratory Practices (GLP)</h3>\r\n\r\n<ul>\r\n<li>Organizational process; includes the conditions under which laboratory studies are planned, performed, monitored, recorded and reported</li>\r\n<li>Purpose<br>\r\n- to promote development of quality test data<br>\r\n- comparable for mutual acceptance in different countries<br>\r\n- to avoid technical barriers to trade<br>\r\n- to develop standards for herbal formulations<br>\r\n- to protect human health and environment<br>\r\n</li>\r\n\r\n<li>GLP principles - Standard Operating Procedures, test facilities, personnel and test systems\r\nGood Clinical Practices (GCP)</li>\r\n\r\n<li> An international ethical and scientific quality standard for designing, conducting, recording and reporting trials that involve human subjects</li>\r\n<li> Compliance with this standard provides public assurance that the rights, safety and well-being of trial subjects are protected, consistent with principles in the declaration of Helsinki, and that the clinical trial data are credible</li>\r\n<li>Objective - to provide a unified standard</li>\r\n\r\n\r\n\r\n</ul>\r\n\r\n\r\n<h2>Research Activities</h2>\r\n\r\n\r\n<h3>Pharmacognosy</h3>\r\n\r\n<ul>\r\n\r\n   <li> Establish bona fides of herbal materials through morphological and microscopic studies</li>\r\n    <li>Maintain herbarium of phyto-medical materials.</li>\r\n\r\n</ul>\r\n\r\n<h3>Formulation and Development</h3>\r\n\r\n<ul>\r\n\r\n   <li> Pre-formulation studies to check the biochemical action of ingredients.</li>\r\n    <li>Trials to assess safety and efficacy of formulations.</li>\r\n    <li>Accelerated stability trials to check physical, chemical, microbiological and biological aspects of formulations.</li>\r\n    <li>Standardize processes for uniform quality.</li>\r\n    <li>Transfer of technology to the production department.</li>\r\n\r\n</ul>\r\n\r\n\r\n<h3>Immuno-pharmacology</h3>\r\n\r\n<ul>\r\n<li>Study the mechanism of drug action at a molecular level.</li>\r\n<li>Attempt to understand the endogenous mediators involved in the activity.</li>\r\n<li>Develop immuno-protective agents to counter opportunistic infections in AIDS, carcinogenic malignancy, septic shock, organ transplantation and chronic infections.</li>\r\n<li>Substitute work with in vitro (in the laboratory) cell line models for in vivo </li>\r\n<li>(in the body) experiments.</li>\r\n</ul>\r\n\r\n\r\n<p>Our approach is based on ensuring the consistent delivery of quality audit services for our clients. We place major emphasis on ensuring client satisfaction in relation to our service delivery. The firm has well established quality standards, policies, procedures and practices in place.</p>\r\n\r\n<p>The Management of  provides close monitoring for day to day quality control in relation to all work done and reports issued by quality control department.</p>'),
(11, '<h1>Our Certificates</h1>\r\n\r\n\r\n\r\n\r\n<h2>Profile of Dr Shashinath Jha</h2>\r\n\r\n<img src="images/dr.jha.jpg" class="img-responsive Inn-img" alt="">\r\n\r\n\r\n\r\n<p>The founder Managing Director of “Nutan Ayurvedic Research Centre” Dr S. M. Jha was born in medical oriented family of famous Ayurvedacharya Vaidyaraj Mahendra Ganesh Jha on 24th nov 1964 at Manik Chauk, Dist. Sitamarhi, Bihar.His Father is (Retd) Chief medical officer and Internationally famous medical practitioner of Ayurveda. In Early childhood of Dr Jha many astrologers had forecasted about his amazing futuristic vision which is true to the word as of today.He has completed his primary and higher secondary education under the guidance of his father. He passed his Secondary School Examination in 1980 from Bihar School Examination Board , Patna, with first division. He has completed Intermediate Science from university of Bihar in the year 1982. He completed his graduation from M..P Sinha Science college, with Honours in Chemistry in First division.He has completed diploma in computer Sciences in 1988. Under the guidance of his elder brother Vaidraj Harinath M. Jha he completed his degree in Ayurved Ratna in first division and after that he was appointed as visiting professor at Maharishi Vedic university, Netherland, following this he specialized in pulse diagnosis and preventive course and served the needy in Germany, Netherlands, U.K. and USA. </p>\r\n<p>Looking to the wide scope and demand of Aloevera in domestic as well as   international market, Mr. Jha did market research on Aloevera plantation   and processing by attending various seminars and workshops at various   places across the country and outside of Country found that Aloevera has   wide scope and huge demand in international &amp; domestic market and   cultivation of Aloe Vera crops need less water and meets most suitable   climate conditions of Rajasthan to utilize waste land and highest   medicinal value among other herbs. Hence Mr. Jha diversified himself to   Aloevera plantation and processing to serve the society globally with   the aim to generate employment especially to the farmer community based   at Gujarat.</p>\r\n\r\n\r\n\r\n<h3><strong>Our Certificates</strong></h3>\r\n<img src="images/narc-12.jpg" class="img-responsive Inn-img" alt="">\r\n\r\n<p><strong>Please find attached the PDF for mor detail list of NARC our certificates:</strong></p>');
